import Header from "../components/Header";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import {Link} from "react-router-dom";

export default function Register() {
    return (
        <>

            <Header></Header>
            <Navbar></Navbar>
            <hr/>
            <h1>Register</h1>
            <h1><center>
                <Link to={"/"}>Login</Link>
            </center></h1>
            <Footer></Footer>
        </>
    )
}
